import React from "react";

const ContactDate = () => {
  return (
    <div class="container-oder">
      <div class="oder__description-title">Інформація для доставки</div>
      <div>
        <div>
          <input type="text" name="username" value="Ваше імʼя" />
        </div>
        <div>
          <input
            type="tel"
            name="phone"
            placeholder="+xx (xxx) xxx xx xx"
            value="Ваш номер телефону"
          />
        </div>
        <div>
          <input type="email" value="E-mail" />
        </div>
      </div>
    </div>
  );
};

export default ContactDate;
